/**
 * The testN function helps reduce the amount of repeated code when running tests that iterate through the game n number
 * of times. This function takes the starting array (gameArray), the dimensions of the grid (xSize,ySize,zSize), the
 * ruleset and n (the number of iterations to run). The resulting array after n iterations is returned.
 * @param gameArray - The state of the game at the start of the test
 * @param {number} xSize The size of the x dimension of the grid
 * @param {number} ySize - The size of the y dimension of the grid
 * @param {number} zSize - The size of the z dimension of the grid
 * @param {object} rules - The ruleset to run the game with (see game.worker.js for supported strings)
 * @param {number} n - The number of iterations of the game to run
 * @returns {*} - The game array after n iterations of the game
 */
function testN(gameArray, xSize, ySize, zSize, rules, n) {
	let result;
	for (let i = 0; i < n; i++) {
		result = workerOnMessage({ "data": [gameArray, xSize, ySize, zSize, rules.birth, rules.survive, rules.max] });
		gameArray = result[0];
	}
	return result;
}